import React from "react";

const MenuItem = ()=>{
    return(
        <div className="menu-item">
        <div className="content" >
            <h1 className="title">HAT</h1>
            <span className="subtitle">SHOP NOW</span>
        </div>
    </div>
    )
}
export default MenuItem;
